import React from 'react';
import logo from '../images/bacola-logo.png';
import { styled } from '@mui/material/styles';
import Box from '@mui/material/Box';
import Paper from '@mui/material/Paper';
import Grid from '@mui/material/Grid';
import InputGroup from 'react-bootstrap/InputGroup'
import { Button } from 'react-bootstrap';
import { FormControl,DropdownButton,Dropdown } from 'react-bootstrap';
import NavSearch from './NavSearch'

export default function Navbar() {
  // ==========Grid==================
  const Item = styled(Paper)(({ theme }) => ({
    ...theme.typography.body2,
    padding: theme.spacing(1),
    textAlign: 'center',
    color: theme.palette.text.secondary,
  }));
  // =================================
  return (
    <>
      <div className='navMain'>
        <div className='subMain'>
          <div className='navFirst'>
            <div className='navFirstMain'>
              <div className='navFirstMainFirst'>
                <InputGroup className="mb-3">
                  <FormControl
                    aria-label="Example text with button addon"
                    aria-describedby="basic-addon1"
                  />
                  <DropdownButton
                    variant="outline-secondary"
                    title="Dropdown"
                    id="input-group-dropdown-1"
                  >
                    <Dropdown.Item href="#">Action</Dropdown.Item>
                    <Dropdown.Item href="#">Another action</Dropdown.Item>
                    <Dropdown.Item href="#">Something else here</Dropdown.Item>
                    <Dropdown.Divider />
                    <Dropdown.Item href="#">Separated link</Dropdown.Item>
                  </DropdownButton>
                  <Button variant="outline-secondary" id="button-addon1">
                    Button
                  </Button>
                </InputGroup>
              </div>
            </div>
          </div>
          <div className='logoDiv'>
            {/* <img src={logo} className='logoimg' alt='logo' /> */}
            <p className='underLogoText'>Online Grocery Shopping Center</p>
          </div>
          <div className='logoDiv'>
            {/* <img src={logo} className='logoimg' alt='logo' /> */}
            <p className='underLogoText'>Online Grocery Shopping Center</p>
          </div>
        </div>
      </div>
    </>
  )
}














